unterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(27107,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}',10190,'Interface {#IFNAME}({#IFALIAS}): Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','60','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,20,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe current operational state of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL),(27118,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.2.2.1.8,{#IFADMINSTATUS},1.3.6.1.2.1.2.2.1.7,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2,{#IFTYPE},1.3.6.1.2.1.2.2.1.3]',10192,'Network Interfaces Discovery','net.if.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,1,NULL,'','Discovering interfaces from IF-MIB. Interfaces with down(2) Administrative Status are not discovered.',0,'30d',0,0,0,'',1,'',NULL),(27119,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.13.{#SNMPINDEX}',10192,'Interface {#IFNAME}({#IFALIAS}): Inbound packets discarded','net.if.in.discards[ifInDiscards.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of inbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent t