lization in %',0,'30d',0,0,0,'',0,'',NULL),(27415,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.48.1.1.1.6.{#SNMPINDEX}',10212,'{#SNMPVALUE}: Available memory','vm.memory.free[ciscoMemoryPoolFree.{#SNMPINDEX}]','180','30d','365d',0,3,'','B','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-MEMORY-POOL-MIB\r\nIndicates the number of bytes from the memory pool that are currently unused on the managed device. Note that the sum of ciscoMemoryPoolUsed and ciscoMemoryPoolFree is the total amount of memory in the pool\r\nReference: http://www.cisco.com/c/en/us/support/docs/ip/simple-network-management-protocol-snmp/15216-contiguous-memory.html',0,'30d',0,0,0,'',0,'',NULL),(27416,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.48.1.1.1.5.{#SNMPINDEX}',10212,'{#SNMPVALUE}: Used memory','vm.memory.used[ciscoMemoryPoolUsed.{#SNMPINDEX}]','180','30d','365d',0,3,'','B','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-MEMORY-POOL-MIB\r\nIndicates the number of bytes from the memory pool that are currently in use by applications on the managed device.\r\nReference: http://www.cisco.com/c/en/us/support/docs/ip/simple-network-management-protocol-snmp/15216-contiguous-memory.html',0,'30d',0,0,0,'',0,'',NULL),(27417,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.109.1.1.1.1.8.{#SNMPINDEX}',10213,'#{#SNMPINDEX}: CPU utilization','system.cpu.util[cpmCPUTotal5minRev.{#SNMPINDEX}]','180','30d','365d',0,0,'','%','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-PROCESS-MIB\r\nThe cpmCPUTotal5minRev MIB object provides a more accurate view of the performance of the router over time than the MIB objects cpmCPUTotal1minRev and cpmCPUTotal5secRev . These MIB objects are not accurate because they look at CPU at one minute and five second intervals, respectively. These MIBs enable you to monitor the trends and plan the capacity of your network. The recommended baseline rising threshold for cpmCPUTotal5minRev is 90 percent. Depending on the platform, some routers that run at 90 percent, for example, 2500s, can exhibit performance degradation versus a high-end router, for example, the 7500 series, which can operate fine.\r\nReference: http://www.cisco.com/c/en/us/support/docs/ip/simple-network-management-protocol-snmp/15215-collect-cpu-util-snmp.html',0,'30d',0,0,0,'',0,'',NULL),(27419,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.47.1.1.1.1.11.{#SNMPINDEX}',10216,'{#ENT_NAME}: Hardware serial number','system.hw.serialnumber[entPhysicalSerialNum.{#SNMPINDEX}]','3600','14d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: ENTITY-MIB',0,'30d',0,0,0,'',0,'',NULL),(27420,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.13.1.3.1.6.{#SNMPINDEX}',10217,'{#SNMPVALUE}: Temperature status','sensor.temp.status[ciscoEnvMonTemperatureState.{#SNMPINDEX}]','180','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,28,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-ENVMON-MIB\r\nThe current state of the test point being instrumented.',0,'30d',0,0,0,'',0,'',NULL),(27421,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.13.1.3.1.3.{#SNMPINDEX}',10217,'{#SNMPVALUE}: Temperature','sensor.temp.value[ciscoEnvMonTemperatureValue.{#SNMPINDEX}]','180','30d','365d',0,0,'','°C','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-ENVMON-MIB\r\nThe current measurement of the test point being instrumented.',0,'30d',0,0,0,'',0,'',NULL),(27422,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.13.1.5.1.3.{#SNMPINDEX}',10217,'{#SENSOR_INFO}: Power supply status','sensor.psu.status[ciscoEnvMonSupplyState.{#SNMPINDEX}]','180','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,28,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-ENVMON-MIB',0,'30d',0,0,0,'',0,'',NULL),(27423,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.9.9.13.1.4.1.3.{#SNMPINDEX}',10217,'{#SENSOR_INFO}: Fan status','sensor.fan.status[ciscoEnvMonFanState.{#SNMPINDEX}]','180','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,28,'','',0,'','','','',0,2,NULL,'','MIB: CISCO-ENVMON-MIB',0,'30d