ame for this managed node.By convention, this is the node\'s fully-qualified domain name.  If the name is unknown, the value is the zero-length string.',3,'30d',0,0,0,'',0,'',NULL),(27662,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.2.0',10227,'System object ID','system.objectid','3600','14d','0',0,1,'','','',0,'','','','',0,'',27155,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe vendor\'s authoritative identification of the network management subsystem contained in the entity.  This value is allocated within the SMI enterprises subtree (1.3.6.1.4.1) and provides an easy and unambiguous means for determining`what kind of box\' is being managed.  For example, if vendor`Flintstones, Inc.\' was assigned the subtree1.3.6.1.4.1.4242, it could assign the identifier 1.3.6.1.4.1.4242.1.1 to its `Fred Router\'.',0,'30d',0,0,0,'',0,'',NULL),(27663,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.3.0',10227,'Device uptime','system.uptime','30','14d','0d',0,3,'','uptime','',0,'','','','',0,'',27159,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe time (in hundredths of a second) since the network management portion of the system was last re-initialized.',0,'30d',0,0,0,'',0,'',NULL),(27664,5,'','',10227,'SNMP availability','zabbix[host,snmp,available]','60','14d','0d',0,3,'','','',0,'','','','',0,'',27154,22,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27665,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.47.1.1.1.1.2,{#MODULE_NAME},1.3.6.1.2.1.47.1.1.1.1.7]',10227,'Module Discovery','module.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,1,NULL,'','Filter limits results to \'Module level1\' or Fabric Modules',0,'30d',0,0,0,'',2,'',NULL),(27666,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.47.1.1.1.1.2,{#MODULE_NAME},1.3.6.1.2.1.47.1.1.1.1.7]',10227,'Temperature Discovery','temp.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,1,NULL,'','Discoveri