o concept of bandwidth, this object should be zero.',0,'30d',0,0,0,'',0,'',NULL),(27796,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}',10231,'Interface {#IFNAME}({#IFALIAS}): Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','60','14d','0d',0,3,'','','',0,'','','','',0,'',27107,20,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe current operational state of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL),(27797,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10231,'Interface {#IFNAME}({#IFALIAS}): Interface type','net.if.type[ifType.{#SNMPINDEX}]','3600','1w','0d',0,3,'','','',0,'','','','',0,'',27100,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,0,'',0,'',NULL),(27798,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.10.7.2.1.19,{#IFOPERSTATUS},1.3.6.1.2.1.2.2.1.8,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2]',10231,'EtherLike-MIB Discovery','net.if.duplex.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',27031,NULL,'','',0,'','','','',0,1,NULL,'','Discovering interfaces from IF-MIB and EtherLike-MIB. Interfaces with up(1) Operational Status are discovered.',0,'30d',0,0,0,'',1,'',NULL),(27799,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.10.7.2.1.19.{#SNMPINDEX}',10231,'Interface {#IFNAME}({#IFALIAS}): Duplex status','net.if.duplex[dot3StatsDuplexStatus.{#SNMPINDEX}]','300','1w','0d',0,3,'','','',0,'','','','',0,'',27032,19,'','',0,'','','','',0,2,NULL,'','MIB: EtherLike-MIB\r\nThe current mode of operation of the MAC\r\nentity.  \'unknown\' indicates that the current\r\nduplex mode could not be determined.\r\n\r\nManagement control of the duplex mode is\r\naccomplished through the MAU MIB.  When\r\nan interface does not support autonegotiation,\r\nor when autonegotiation is not enabled, the\r\nduplex mode is controlled using\r\nifMauDefaultType.  When autonegotiation is\r\nsupported and enabled, duplex mode is controlled\r\nusing ifMauAutoNegAdvertisedBits.  In either\r\ncase, the currently operating duplex mode is\r\nreflected both in this object and in ifMauType.\r\n\r\nNote that this object provides redundant\r\ninformation with ifMauType.  Normally, redundant\r\nobjects are discouraged.  However, in this\r\ninstance, it allows a management application to\r\ndetermine the duplex status of an interface\r\nwithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,0,'',0,'',NULL),(27800,3,'','',10231,'ICMP ping','icmpping','60','1w','365d',0,3,'','','',0,'','','','',0,'',27149,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27801,3,'','',10231,'ICMP loss','icmppingloss','60','1w','365d',0,0,'','%','',0,'','','','',0,'',27150,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27802,3,'','',10231,'ICMP response time','icmppingsec','60','1w','365d',0,0,'','s','',0,'','','','',0,'',27151,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27803,17,'','',10231,'SNMP traps (fallback)','snmptrap.fallback','300','14d','0',0,2,'','','',0,'','','','',0,'hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','',0,0,NULL,'','Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,0,0,'',0,'',NULL),(27804,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.4.0',10231,'Device contact details','system.contact','3600','14d','0',0,1,'','','',0,'','','','',0,'',27156,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe textual identification of the contact person for this managed node, together with information on how to contact this person.  If no contact information is known, the value is the zero-length string.',23,'30d',0,0,0,'',0,'',NULL),(27805,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.1.0',10231,'Device description','system.descr','3600','14d','0',0,1,'','','',0,'','','','',0,'',27153,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nA textual description of the entity.  This value should\r\ninclude the full name and version identification of the system\'s hardware type, software operating-system, and\r\nnetworking software.',14,'30d',0,0,0,'',0,'',NULL),(27806,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.6.0',10231,'Device location','system.location','3600','14d','0',0,1,'','','',0,'','','','',0,'',27158,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe physical location of this node (e.g., `telephone closet, 3rd floor\').  If the location is unknown, the value is the zero-length string.',24,'30d',0,0,0,'',0,'',NULL),(27807,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.5.0',10231,'Device name','system.name','3600','14d','0',0,1,'','','',0,'','','','',0,'',27152,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nAn administratively-assigned name for this managed node.By convention, this is the node\'s fully-qualified domain name.  If the name is unknown, the value is the zero-length string.',3,'30d',0,0,0,'',0,'',NULL),(27808,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.2.0',10231,'System object ID','system.objectid','3600','14d','0',0,1,'','','',0,'','','','',0,'',27155,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe vendor\'s authoritative identification of the network management subsystem contained in the entity.  This value is allocated within the SMI enterprises subtree (1.3.6.1.4.1) and provides an easy and unambiguous means for determining`what kind of box\' is being managed.  For example, if vendor`Flintstones, Inc.\' was assigned the subtree1.3.6.1.4.1.4242, it could assign the identifier 1.3.6.1.4.1.4242.1.1 to its `Fred Router\'.',0,'30d',0,0,0,'',0,'',NULL),(27809,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.3.0',10231,'Device uptime','system.uptime','30','14d','0d',0,3,'','uptime','',0,'','','','',0,'',27159,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe time (in hundredths of a second) since the network management portion of the system was last re-initialized.',0,'30d',0,0,0,'',0,'',NULL),(27810,5,'','',10231,'SNMP availability','zabbix[host,snmp,available]','60','14d','0d',0,3,'','','',0,'','','','',0,'',27154,22,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL),(27811,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.1.0',10231,'Operating system','system.sw.os','3600','14d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB',5,'30d',0,0,0,'',0,'',NULL),(27812,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.2636.3.1.2.0',10231,'Hardware model name','system.hw.model','3600','14d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,0,NULL,'','MIB: JUNIPER-MIB\r\nThe name, model, or detailed description of the box,indicating which product the box is about, for example \'M40\'.',29,'30d',0,0,0,'',0,'',NULL),(27813,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.2636.3.1.3.0',10231,'Hardware serial number','system.hw.serialnumber','3600','14d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,0,NULL,'','MIB: JUNIPER-MIB\r\nThe serial number of this subject, blank if unknown or unavailable.',8,'30d',0,0,0,'',0,'',NULL),(27814,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.2636.3.4.2.3.1.0',10231,'Overall system health status','system.status[jnxRedAlarmState.0]','30','14d','0d',0,3,'','','',0,'','','','',0,'',NULL,46,'','',0,'','','','',0,0,NULL,'','MIB: JUNIPER-ALARM-MIB\r\nThe red alarm indication on the craft interface panel.\r\nThe red alarm is on when there is some system\r\nfailure or power supply failure or the system\r\nis experiencing a hardware malfunction or some\r\nthreshold is being exceeded.\r\n\r\nThis red alarm state could be turned off by the\r\nACO/LT (Alarm Cut Off / Lamp Test) button on the\r\nfront panel module.',0,'30d',0,0,0,'',0,'',NULL),(27815,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.4.1.2636.3.1.13.1.5]',10231,'CPU and Memory Discovery','jnxOperatingTable.discovery','3600','90d','0',0,4,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,1,NULL,'','Scanning JUNIPER-MIB::jnxOperatingTable for CPU and Memory\r\nhttp://kb.juniper.net/InfoCenter/index?page=content&id=KB17526&actp=search. Filter limits results to Routing Engines',0,'30d',0,0,0,'',0,'',NULL),(27816,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.4.1.2636.3.1.13.1.7,{#SENSOR_INFO},1.3.6.1.4.1.2636.3.1.13.1.5]',10231,'Temperature discovery','jnxOperatingTable.discovery.temp','3600','90d','0',0,4,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,1,NULL,'','Scanning JUNIPER-MIB::jnxOperatingTable for Temperature\r\nhttp://kb.juniper.net/InfoCenter/index?page=content&id=KB17526&actp=search. Filter limits results to Routing Engines',0,'30d',0,0,0,'',0,'',NULL),(27817,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.4.1.2636.3.1.13.1.5.4]',10231,'FAN Discovery','jnxOperatingTable.discovery.fans','3600','90d','0',0,4,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,1,NULL,'','Scanning JUNIPER-MIB::jnxOperatingTable for Fans',0,'30d',0,0,0,'',0,'',NULL),(27818,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.4.1.2636.3.1.13.1.5.2]',10231,'PSU Discovery','jnxOpe