 a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(28177,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.14.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Inbound packets with errors','net.if.in.errors[ifInErrors.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27106,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of inbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of inbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(28178,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.6.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Bits received','net.if.in[ifHCInOctets.{#SNMPINDEX}]','180','30d','365d',0,3,'','bps','',0,'','','','',0,'',27104,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets received on the interface,including framing characters.  This object is a 64-bit version of ifInOctets. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(28179,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.19.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Outbound packets discarded','net.if.out.discards[ifOutDiscards.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27102,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of outbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(28180,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.20.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Outbound packets with errors','net.if.out.errors[ifOutErrors.{#SNMPINDEX}]','300','1w','365d',0,3,'','','',0,'','','','',0,'',27103,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of outbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of outbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(28181,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.10.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Bits sent','net.if.out[ifHCOutOctets.{#SNMPINDEX}]','180','30d','365d',0,3,'','bps','',0,'','','','',0,'',27105,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets transmitted out of the interface, including framing characters.  This object is a 64-bit version of ifOutOctets.Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL),(28182,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.15.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Speed','net.if.speed[ifHighSpeed.{#SNMPINDEX}]','300','1w','0d',0,3,'','bps','',0,'','','','',0,'',27101,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nAn estimate of the interface\'s current bandwidth in units of 1,000,000 bits per second.  If this object reports a value of `n\' then the speed of the interface is somewhere in the range of `n-500,000\' to`n+499,999\'.  For interfaces which do not vary in bandwidth or for those where no accurate estimation can be made, this object should contain the nominal bandwidth.  For a sub-layer which has no concept of bandwidth, this object should be zero.',0,'30d',0,0,0,'',0,'',NULL),(28183,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','60','14d','0d',0,3,'','','',0,'','','','',0,'',27107,20,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe current operational state of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL),(28184,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10251,'Interface {#IFNAME}({#IFALIAS}): Interface type','net.if.type[ifType.{#SNMPINDEX}]','3600','1w','0d',0,3,'','','',0,'','','','',0,'',27100,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assi